import { useState } from "react";
import { Eye, EyeOff } from "lucide-react";
import { Button } from "@/components/ui/button";
import { Input } from "@/components/ui/input";
import { Card, CardContent } from "@/components/ui/card";

export default function AuthPage() {
  const [showPassword, setShowPassword] = useState(false);
  const [isLogin, setIsLogin] = useState(true);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData(e.target);
    const payload = Object.fromEntries(formData.entries());

    const endpoint = isLogin ? "/api/auth/login" : "/api/auth/signup";
    const response = await fetch(endpoint, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(payload)
    });

    const data = await response.json();
    console.log(data);
    alert(data.message || "Success!");
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-r from-cyan-400 via-blue-500 to-purple-600 p-6">
      <Card className="w-full max-w-4xl grid md:grid-cols-2 shadow-2xl rounded-2xl overflow-hidden">
        <div className="hidden md:flex items-center justify-center bg-white p-6">
          <img src="/assets/login_psge_img.jpg" alt="Login Illustration" className="rounded-lg" />
        </div>
        <CardContent className="p-8 bg-white">
          <div className="flex justify-center mb-6">
            <img src="/assets/UpToSkills_Logo.svg" alt="Logo" className="h-12" />
          </div>
          <h2
            className="text-2xl font-bold text-center mb-6 bg-clip-text text-transparent"
            style={{
              backgroundImage: `url(/assets/heading_color.jpg)`,
              backgroundSize: "cover",
              backgroundPosition: "center",
            }}
          >
            {isLogin ? "Login to Your Account" : "Create an Account"}
          </h2>
          <form className="space-y-4" onSubmit={handleSubmit}>
            {!isLogin && (
              <Input type="text" name="name" placeholder="Full Name" required className="p-3 rounded-xl" />
            )}
            <Input type="email" name="email" placeholder="Email" required className="p-3 rounded-xl" />
            <div className="relative">
              <Input
                type={showPassword ? "text" : "password"}
                name="password"
                placeholder="Password"
                required
                className="p-3 rounded-xl pr-10"
              />
              <button
                type="button"
                className="absolute right-3 top-3 text-gray-500"
                onClick={() => setShowPassword(!showPassword)}
              >
                {showPassword ? <EyeOff size={20} /> : <Eye size={20} />}
              </button>
            </div>
            <Button className="w-full rounded-xl bg-blue-600 hover:bg-blue-700 text-white p-3" type="submit">
              {isLogin ? "Login" : "Sign Up"}
            </Button>
          </form>
          <div className="my-6 flex items-center justify-center text-gray-400 text-sm">
            <span className="mx-2">Or continue with</span>
          </div>
          <div className="flex gap-4 justify-center">
            <button className="border p-3 rounded-full">
              <img src="/assets/google_icon.svg" alt="Google" className="h-6 w-6" />
            </button>
            <button className="border p-3 rounded-full">
              <img src="/assets/apple_icon.svg" alt="Apple" className="h-6 w-6" />
            </button>
          </div>
          <p className="text-center text-gray-600 mt-6">
            {isLogin ? "Don't have an account?" : "Already have an account?"}
            <button
              type="button"
              onClick={() => setIsLogin(!isLogin)}
              className="ml-2 text-blue-600 font-semibold"
            >
              {isLogin ? "Sign Up" : "Login"}
            </button>
          </p>
        </CardContent>
      </Card>
    </div>
  );
}
